import React from 'react';
import { useNavigate } from 'react-router-dom';

function Logout() {
  const navigate = useNavigate();


  return (
    <div>
      <h2>Do you want to logout</h2>
      <button onClick={() => navigate("/")}>Logout</button>
    </div>
  );
}

export default Logout;
